import Navbar from "./components/Navbar";
import Home from "./components/Home";
import Footer from "./components/partials/Footer";
import { BrowserRouter } from "react-router-dom";
import About from "./components/About";
import Products from "./components/Products";
import FloatingForm from "./components/FloatingForm";
import SecondPopupForm from "./components/SecondPopupForm";
import Tile from "./components/Tile";
import { useState, useEffect } from "react";
import ContactUs from "./components/ContactUs";
import { Route } from "react-router-dom";
function App() {
  const [showSecondPopup, setShowSecondPopup] = useState(false); // Control visibility of SecondPopupForm

  const handleCloseSecondPopup = () => {
    setShowSecondPopup(false); // Close the enquiry popup
  };

  useEffect(() => {
    // Automatically show the SecondPopupForm every 15 seconds
    const interval = setInterval(() => {
      setShowSecondPopup(true);
    }, 15000); // 15 seconds interval

    return () => clearInterval(interval); // Cleanup on unmount
  }, []);

  return (
    <BrowserRouter>
      <>
        <Navbar />
      </>
      {/* <div>
        <Home />
        <Products />
        <About />
        <ContactUs />
        <Footer />
      </div> */}
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/products" element={<Products />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact-us" element={<ContactUs />} />
        <Route path="/privacy-policy" element={<PrivacyPolicy />} /> {/* Add this route */}
      </Routes>
      <SecondPopupForm isVisible={showSecondPopup} closeForm={handleCloseSecondPopup} />
      <FloatingForm />
      <Tile />
    </BrowserRouter>
  );
}

export default App;
